import React, { Component } from 'react'
import PropTypes from 'prop-types'

class Graph extends Component {
    render() {
        const stock = this.props.stock;

        return (
            <tr>
                <td> {stock.ticker} </td>
                <td> {stock.volume} </td>
            </tr>
        )

    }
}

//Graph.PropTypes = {
  //  data: PropTypes.array.isRequired
//}
export default Graph;
